create table ngcobjects (
 id number(4) constraint pk_ngcobjects primary key,
 ra varchar2(20) not null,
 dec varchar2(20) not null,
 m float,
 constellationID varchar(3) not null,
 yearOfDiscovery number,
 objectTypeID number not null,
 discovererID number not null,
 constraint fk_ngcobjects1 foreign key (constellationID) references constellations (abbr),
 constraint fk_ngcobjects2 foreign key (objectTypeID) references objecttypes (id),
 constraint fk_ngcobjects3 foreign key (discovererID) references discoverers (id)
);

